import React, { useEffect, useState } from 'react';
import io from 'socket.io-client';
import LandingPage from './LandingPage';
import Login from './Login';
import Register from './Register';
import Dashboard from './Dashboard';
import api from './api';

const socket = io('http://localhost:4000');

export const SocketContext = React.createContext();

function App(){
  const [notifications, setNotifications] = useState([]);
  const [user, setUser] = useState(null);
  const [currentPage, setCurrentPage] = useState('landing'); // 'landing', 'login', 'register', 'dashboard'

  useEffect(()=> {
    const raw = localStorage.getItem('church_user');
    if (raw) {
      const userData = JSON.parse(raw);
      setUser(userData);
      setCurrentPage('dashboard');
      api.setToken(userData.token);
    }

    socket.on('new_booking', (booking) => addNotification({ type:'new_booking', text: `New booking: ${booking.service_type} on ${booking.date} (${booking.time_slot})`}));
    socket.on('booking_deleted', (info) => addNotification({ type:'deleted', text: `Booking cancelled for ${info.date}`}));
    socket.on('calendar_config_updated', (info) => addNotification({ type:'config', text: `Calendar updated: ${info.date} max slots ${info.max_slots}`}));

    return ()=> {
      socket.off('new_booking');
      socket.off('booking_deleted');
      socket.off('calendar_config_updated');
    }
  },[]);

  const addNotification = (n) => setNotifications(prev => [n,...prev].slice(0,20));

  const handleLogin = (user, token) => {
    const u = { ...user, token };
    localStorage.setItem('church_user', JSON.stringify(u));
    api.setToken(token);
    setUser(u);
  }

  const handleLogout = () => {
    localStorage.removeItem('church_user');
    api.setToken(null);
    setUser(null);
  }

  return (
    <SocketContext.Provider value={socket}>
      <div style={{ display:'flex', height:'100vh', background:'#f5f7fa' }}>
        <div style={{ flex:1, padding:'40px', overflowY:'auto', background:'white' }}>
          <h1>â›ª Church Booking Calendar</h1>
          {!user && (
            <div style={{ maxWidth:'500px', margin:'0 auto' }}>
              <Login onLogin={handleLogin} />
              <hr />
              <Register onRegister={handleLogin} />
            </div>
          )}
          {user && (
            <>
              <div style={{ background:'linear-gradient(135deg, #667eea 0%, #764ba2 100%)', color:'white', padding:'20px', borderRadius:'12px', marginBottom:'24px', display:'flex', justifyContent:'space-between', alignItems:'center' }}>
                <div>
                  <p style={{ margin:'0 0 4px 0', fontSize:'14px', opacity:0.9 }}>Signed in as</p>
                  <h2 style={{ margin:0, color:'white', fontSize:'20px' }}>{user.name} <span style={{ fontSize:'14px', opacity:0.9 }}>({user.role})</span></h2>
                </div>
                <button onClick={handleLogout} style={{ background:'rgba(255,255,255,0.2)', borderRadius:'8px' }}>Logout</button>
              </div>
              <CalendarView addNotification={addNotification} />
              {user.role === 'admin' && <AdminDashboard addNotification={addNotification} />}
            </>
          )}
        </div>
        <div style={{ width:'380px', borderLeft:'1px solid #e2e8f0', padding:'20px', background:'#f9fafb', overflowY:'auto', boxShadow:'-2px 0 8px rgba(0,0,0,0.05)' }}>
          <h3 style={{ marginTop:0 }}>ðŸ“¬ Notifications</h3>
          <Notifications items={notifications} />
        </div>
      </div>
    </SocketContext.Provider>
  )
}

export default App;
